CREATE DEFINER=`root`@`localhost` PROCEDURE `EtlEstadisticaEnergiaRenovableCapacidad`()
BEGIN
	
    CREATE TABLE IF NOT EXISTS datawarehause.EstadisticaEnergiaRenovableCapacidad(
	IdEstadistica INT PRIMARY KEY AUTO_INCREMENT,
    Pais VARCHAR(50),
    GrupoTecnologia VARCHAR(200),
    Tecnologia VARCHAR(200),
    TipoDoductor VARCHAR(200),
    Anio VARCHAR(50),
    Unidad VARCHAR(200),
    Valor FLOAT
	);

 -- Validar si hay registros en la tabla
    IF(SELECT COUNT(1) FROM datawarehause.EstadisticaEnergiaRenovableCapacidad)>0 THEN
		DELETE FROM datawarehause.EstadisticaEnergiaRenovableCapacidad WHERE IdEstadistica>0;
        TRUNCATE TABLE datawarehause.EstadisticaEnergiaRenovableCapacidad;
    END IF;
    
	-- Insertar datos en la tabla
    INSERT INTO datawarehause.EstadisticaEnergiaRenovableCapacidad(Pais,GrupoTecnologia,Tecnologia,TipoDoductor,Anio,Unidad,Valor)
    SELECT DISTINCT ES.Pais,ES.GrupoTecnologia,
	IFNULL(JO.Tecnologia,ES.Tecnologia) AS Tecnologia,
	IFNULL(JO.TipoDoductor,ES.TipoDoductor) AS TipoDoductor,
	IFNULL(JO.Anio,ES.Anio) AS Anio,IFNULL(JO.Unidad,ES.Unidad) AS Unidad,
	CASE WHEN JO.Tecnologia=ES.Tecnologia AND JO.TipoDoductor=ES.TipoDoductor
	AND JO.Unidad=ES.Unidad AND JO.Unidad=ES.Unidad  THEN avg(CAST(es.Valor AS FLOAT))
	ELSE avg(CAST(es.Valor AS FLOAT)) END AS Valor
	FROM datawarehause.estadisticaenergiarenovablecapacidad AS ES
	LEFT JOIN (
	SELECT Tecnologia,Unidad,TipoDoductor,Anio,count(Anio) cant
	FROM datawarehause.estadisticaenergiarenovablecapacidad
	group by Tecnologia,Unidad,TipoDoductor,Anio
	having count(anio)>1
	 ) AS JO ON JO.Tecnologia=ES.Tecnologia AND JO.Unidad=ES.Unidad
	AND JO.TipoDoductor=ES.TipoDoductor AND JO.Anio=ES.Anio 
	GROUP BY ES.Pais,ES.GrupoTecnologia,
	IFNULL(JO.Tecnologia,ES.Tecnologia),
	IFNULL(JO.TipoDoductor,ES.TipoDoductor),
	IFNULL(JO.Anio,ES.Anio) ,
	IFNULL(JO.Unidad,ES.Unidad),
	JO.Tecnologia,ES.Tecnologia, 
	JO.TipoDoductor,ES.TipoDoductor,
	JO.Unidad,ES.Unidad ,JO.Unidad,ES.Unidad
	ORDER BY Anio;

END ;;
