CREATE DEFINER=`root`@`localhost` PROCEDURE `EtlZonasNoInterconectada`()
BEGIN
 -- Crear la nueva tabla
CREATE TABLE IF NOT EXISTS datawarehause.ZonasNoInterconectada(
	IdZonaNC INT PRIMARY KEY AUTO_INCREMENT,
    NombreDepartamento VARCHAR(200),
    NombreMunicipio VARCHAR(200),
    Anio VARCHAR(50),
    Mes VARCHAR(50),
    EnergiaActiva FLOAT,
    EnergiaReactiva FLOAT,
    DiaDemandaMaxima VARCHAR(50),
	PotenciaMaxima FLOAT,
    FechaDemandaMaxima DATE,
    PromedioDiarioHoras FLOAT
);
 -- Validar si hay registros en la tabla
    IF(SELECT COUNT(1) FROM datawarehause.ZonasNoInterconectada)>0 THEN
		DELETE FROM datawarehause.ZonasNoInterconectada WHERE IdZonaNC>0;
        TRUNCATE TABLE datawarehause.ZonasNoInterconectada;
    END IF;
    -- Insertar datos en la tabla
	INSERT INTO datawarehause.ZonasNoInterconectada(
		NombreDepartamento, NombreMunicipio, Anio, Mes, 
		EnergiaActiva, EnergiaReactiva, PotenciaMaxima, 
		DiaDemandaMaxima, FechaDemandaMaxima, PromedioDiarioHoras
	)
	SELECT DISTINCT
		IFNULL(LOWER(D.Nombre), '-') AS NombreDepartamento,
		IFNULL(LOWER(M.Nombre), '-') AS NombreMunicipio,
		IFNULL(LOWER(AN.Valor), '-') AS Anio,
		IFNULL(LOWER(ME.Valor), '-') AS Mes,
		IFNULL(CAST(Z.EnergiaActiva AS FLOAT), 0) AS EnergiaActiva,
		IFNULL(CAST(Z.EnergiaReactiva AS FLOAT), 0) AS EnergiaReactiva,
		IFNULL(CAST(Z.PotenciaMaxima AS FLOAT), 0) AS PotenciaMaxima,
		IFNULL(LOWER(DI.Valor), '-') AS DiaDemandaMaxima,
		IFNULL(DATE(Z.FechaDemandaMaxima), '0000-00-00') AS FechaDemandaMaxima,
		IFNULL(CAST(Z.PromedioDiarioHoras AS FLOAT), 0) AS PromedioDiarioHoras
	FROM energiacol.ZonasNoInterconectadas AS Z 
	INNER JOIN energiacol.departamento AS D ON Z.IdDepartamento = D.IdDepartamento
	INNER JOIN energiacol.municipio AS M ON Z.IdMunicipio = M.IdMunicipio
	INNER JOIN energiacol.anio AS AN ON Z.AnioServicio = AN.IdAnio
	INNER JOIN energiacol.dias AS DI ON Z.DiaDemandaMaxima = DI.IdDia
	INNER JOIN energiacol.mes AS ME ON Z.MesServicio = ME.IdMes;
END ;;
